import { Morph } from "lively.morphic";
import { arr, grid } from "lively.lang/index.js";
import { loadObjectFromPartsbinFolder } from "lively.morphic/partsbin.js";
import { pt, Color } from "lively.graphics/index.js";
import { connect } from "lively.bindings/index.js";

export default class Game_dash_of_dash_life extends Morph {


  reset() {
    this.cells().forEach(ea => ea.reset());
    this.stopStepping();

    this.get("stop-button").label = "stop";
    connect(this.get("stop-button"), 'fire', this, 'stopStepping');
    this.get("start-button").label = "start";
    connect(this.get("start-button"), 'fire', this, 'interactivelyStart');
    this.get("reset-button").label = "reset";
    connect(this.get("reset-button"), 'fire', this, 'interactivelyReset');

    // this.reset();
    // this.startStepping(200, "step")
    // this.populate(30,30)
    // this.initRandom()
    // this.submorphs = []
    // this.show()
  }

  async interactivelyStart() {
    var time = Number(await $world.prompt("Step time in ms?", {input: "20"}));
    time ? this.startStepping(time, "step") : this.startStepping("step");
  }

  async interactivelyReset() {    
    var size = Number(await $world.prompt("How big?", {input: String(Math.sqrt(this.cells().length) || 20)}));
    if (!size) return;
    await this.populate(size, size);
    this.initRandom();
  }



  initRandom() {
    // game.reset();
    var percentAlive = .4;
    var cells = this.cells();
    arr.shuffle(cells).slice(0,cells.length * percentAlive)
      .forEach(ea => ea.state= "alive");
  }

  asGrid() {
    // this.asGrid()[3].invoke("show");
    var maxRow = arr.max(this.cells(), ea => ea.row).row,
        grid = this.cells().reduce((grid, cell) => {
          grid[cell.row][cell.col] = cell; return grid;
        }, lively.lang.arr.range(0,maxRow).map(() => []));
    return grid;
  }

  cells() { return arr.without(this.submorphs, this.get("controls")); }

  exportAsGrid() {
    return grid.map(this.asGrid(), cell => cell.state);
  }

  importFromGrid(stateGrid) {
    // stateGrid like
    // [["dead", "alive", "dead"],
    //  ["alive", "alive", "dead"],
    //  ["dead", "alive", "alive"]]

    grid.map(this.asGrid(),
      (cell, i, j) => {
        var newState = stateGrid[i] && stateGrid[i][j];
        if (newState) cell.state = newState;
      });
  }

  async populate(nRows = 20, nCols = 20) {
    var proto = await loadObjectFromPartsbinFolder("game-of-life-proto-cell"),
        controls = this.getSubmorphNamed("controls"),
        {borderWidthLeft, borderWidthRight,
         borderWidthTop, borderWidthBottom} = this

    arr.invoke(this.cells(), "remove");

    Object.assign(proto, {extent: pt(5,5), reactsToPointer: false});

    var newHeight = nRows*proto.height + borderWidthTop + borderWidthBottom,
        newWidth = nCols*proto.width + borderWidthLeft + borderWidthRight;
    controls.position = pt(0, newHeight);
    controls.width = newWidth;
    newHeight += controls.height;

    this.extent = pt(newWidth, newHeight);

    // var cells = lively.morphic.Morph.createN(
    //   cols*rows, function() { return proto.copy(); })
    var cells = arr.range(1, nCols * nRows).map(() => proto.copy());
    this.submorphs = [...this.submorphs, ...cells];

    var length = proto.extent.x;

    for (var i = 0; i < nCols; i++) {
      for (var j = 0; j < nRows; j++) {
        var cell = cells.pop();
        cell.col = i;
        cell.row = j;
        cell.position = pt(i * length + borderWidthLeft, j * length + borderWidthTop);
      }
    }
  }

  step() {
    var dying = this.cells().filter(cell => cell.isDying()),
        reborn = this.cells().filter(cell => cell.isReborn());
    dying.forEach(ea => ea.state = "dead");
    reborn.forEach(ea => ea.state = "alive");
  }

}

