import { Morph } from "lively.morphic";
import { arr, obj } from "lively.lang/index.js";
import { Color } from "lively.graphics/index.js";

export default class Game_dash_of_dash_life_dash_cell extends Morph {

  static get properties() {
    // this.state = "alive"
    return {
      col: {}, row: {},
      state: {
        defaultValue: "alive",
        set(newState) {
          this._neighbors = null;
          if (newState !== "dead" && newState !== "alive")
            throw new Error("Invalid state: " + newState);
          this.setProperty("state", newState);
          this.renderGameOfLifeCell();
        }
      }
    }
  }

  reset() {
    // state can be "dead" or "alive"
    this.state = "dead";
    this.renderGameOfLifeCell();
    this.grabbable = false;
  }

  isAlive() { return this.state === "alive"; }


  isDying() {
    return this.state === "alive"
        && (arr.invoke(this.neighbors(), "isAlive").filter(Boolean).length < 2
         || arr.invoke(this.neighbors(), "isAlive").filter(Boolean).length > 3);
  }


  isReborn() {
    return this.state === "dead"
        && arr.invoke(this.neighbors(), "isAlive").filter(Boolean).length === 3;
  }


  neighbors() {
    return obj.values(this.neighborsByPosition());
  }


  neighborsByPosition() {

    // computes the eight neighbors of a cell and returns it as an object with
    // fields top, bottom, left, right, bottomLeft, bottomRight, topLeft, topRight,

    // the code below isn't written in the most efficient manner to maintain
    // readability. Since we are looping a couple of times over the morph array for
    // each cell it takes a while to compute. This is why we cache the result
    if (this._neighborsByPosition) return this._neighborsByPosition;

    var row = this.row, col = this.col,
        others = arr.without(this.owner.submorphs, this),

        // we could store the row / col but why when you can compute it...
        maxRow = arr.max(others, ea => ea.row).row + 1,
        maxCol = arr.max(others, ea => ea.col).col + 1,

        // left, right, top and bottom
        l = {row: row, col: col-1},
        r = {row: row, col: col+1},
        t = {row: row-1, col: col},
        b = {row: row+1, col: col}

    // make it "infinite", i.e. when cell is at the right edge its right neighbor
    // is the lefmost cell on the same row, etc.
    l.col = l.col < 0 ? maxCol + l.col : l.col % maxCol;
    r.col = r.col < 0 ? maxCol + r.col : r.col % maxCol;
    t.row = t.row < 0 ? maxCol + t.row : t.row % maxRow;
    b.row = b.row < 0 ? maxCol + b.row : b.row % maxRow;

    // the cells on the diagonal can be derived
    var tl = {row: t.row, col: l.col},
        tr = {row: t.row, col: r.col},
        bl = {row: b.row, col: l.col},
        br = {row: b.row, col: r.col},

        neighbors = {
          top:         others.find(ea => ea.row === t.row && ea.col === t.col),
          bottom:      others.find(ea => ea.row === b.row && ea.col === b.col),
          left:        others.find(ea => ea.row === l.row && ea.col === l.col),
          right:       others.find(ea => ea.row === r.row && ea.col === r.col),
          bottomLeft:  others.find(ea => ea.row === bl.row && ea.col === bl.col),
          bottomRight: others.find(ea => ea.row === br.row && ea.col === br.col),
          topLeft:     others.find(ea => ea.row === tl.row && ea.col === tl.col),
          topRight:    others.find(ea => ea.row === tr.row && ea.col === tr.col)
        }

    return this._neighborsByPosition = neighbors;
  }


  onMouseDown(evt) {
    this.state = this.state === "alive" ? "dead" : "alive";
  }


  renderGameOfLifeCell() {
    this.fill = this.state === "alive" ? Color.black : Color.white;
  }

}
